    onCreate?: ((this: {
      options: Options,
      editor: Editor,
      type: MarkType,
      parentConfig: ParentConfig<MarkConfig<Options>>,
    }) => void) | null,

    /**
     * The content has changed.
     */
    onUpdate?: ((this: {
      options: Options,
      editor: Editor,
      type: MarkType,
      parentConfig: ParentConfig<MarkConfig<Options>>,
    }) => void) | null,

    /**
     * The selection has changed.
     */
    onSelectionUpdate?: ((this: {
      options: Options,
      editor: Editor,
      type: MarkType,
      parentConfig: ParentConfig<MarkConfig<Options>>,
    }) => void) | null,

    /**
     * The editor state has changed.
     */
    onTransaction?: ((
      this: {
        options: Options,
        editor: Editor,
        type: MarkType,
        parentConfig: ParentConfig<MarkConfig<Options>>,
      },
      props: {
        transaction: Transaction,
      },
    ) => void) | null,

    /**
     * The editor is focused.
     */
    onFocus?: ((
      this: {
        options: Options,
        editor: Editor,
        type: MarkType,
        parentConfig: ParentConfig<MarkConfig<Options>>,
      },
      props: {
        event: FocusEvent,
      },
    ) => void) | null,

    /**
     * The editor isn’t focused anymore.
     */
    onBlur?: ((
      this: {
        options: Options,
        editor: Editor,
        type: MarkType,
        parentConfig: ParentConfig<MarkConfig<Options>>,
      },
      props: {
        event: FocusEvent,
      },
    ) => void) | null,

    /**
     * The editor is destroyed.
     */
    onDestroy?: ((this: {
      options: Options,
      editor: Editor,
      type: MarkType,
      parentConfig: ParentConfig<MarkConfig<Options>>,
    }) => void) | null,

    /**
     * Keep mark after split node
     */
    keepOnSplit?: boolean | (() => boolean),

    /**
     * Inclusive
     */
    inclusive?: MarkSpec['inclusive'] | ((this: {
      options: Options,
      parentConfig: ParentConfig<MarkConfig<Options>>,
    }) => MarkSpec['inclusive']),

    /**
     * Excludes
     */
    excludes?: MarkSpec['excludes'] | ((this: {
      options: Options,
      parentConfig: ParentConfig<MarkConfig<Options>>,
    }) => MarkSpec['excludes']),

    /**
     * Group
     */
    group?: MarkSpec['group'] | ((this: {
      options: Options,
      parentConfig: ParentConfig<MarkConfig<Options>>,
    }) => MarkSpec['group']),

    /**
     * Spanning
     */
    spanning?: MarkSpec['spanning'] | ((this: {
